import Character from "../Character"
import Container from "../layout/Container"

function Home(){
    const charMale = 'https://rickandmortyapi.com/api/character/47'
    const charFemale = 'https://rickandmortyapi.com/api/character/344'
    return (
        <Container>
            <Character api={charMale}/>
            <Character api={charFemale}/>
        </Container>
    )
}

export default Home
